    #include <stdio.h>
    # define x 100000
    int a[x];

    int main()
    {
        int i,j,t,n,m,flag;                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               ;
        for(i=2;i<x;i++)
        {
            a[i]=i;
        }
        for(i=2;i<=sqrt(x);i++)
        {
            if(a[i]!=0)
            {
                for(j=i*i;j<x;j++)
                {
                    if(a[j]%i==0)
                    {
                        a[j]=0;
                    }
                }
            }
        }
        scanf("%d",&t);
        while(t--)
        {
            scanf("%d %d",&m,&n);
            if(m==1)
                m++;

            for(i=m;i<=n;i++)
            {
                for(j=2,flag=1;j<=sqrt(i);j++)
                {
                    if(a[j]!=0)
                    {
                        if(i%a[j]==0)
                        {
                            flag=0;
                            break;
                        }
                    }
                }
                if(flag==1)
                    printf("%d\n",i);
            }
            printf("\n");
        }
        return 0;
    }
